import { StyleSheet } from "react-native";

export default StyleSheet.create({
  input: {
    height: 50,
    width: "100%",
    borderColor: "#e6e6e6",
    borderWidth: 1,
    borderRadius: 5,
    paddingHorizontal: 10,
    marginTop: 10,
    backgroundColor: "#fff",
  }
});
